import React from "react";
import "./AddUser.css";
import Button from "./Button";
import Card from "../UI/Card"

const AddUser = () => {
    return (
        <Card>
            <div class="main">
                <form>
                    <div class="flex-item">
                        <label>Username</label>
                        <input type="text" />
                    </div>
                    <div class="flex-item">
                        <label>Age (Years)</label>
                        <input type="number" />
                    </div>
                    <div class="flex-item">
                        <Button />
                    </div>
                </form>
            </div>
        </Card>
    );
};

export default AddUser;
